import logo from './logo.svg';
import './App.css';

import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Button,
  makeStyles,
  createStyles,
} from "@material-ui/core";
import MenuIcon from '@material-ui/core/Menu';

function App() {
  return (
    <div>
      <AppBar>
        <Toolbar>
          <IconButton>
            <MenuIcon />
          </IconButton>
          <Typography variant="h6">
            This is a heading
          </Typography>
          <Button>Sign In</Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default App;
